import React from 'react';
import { xml2js } from 'xml-js';
import { useState, useEffect } from 'react';
import "./prikaz.css"; 

function debugBase64(base64URL, mediaType){
  var win = window.open();
  win.document.write(`
    <iframe frameborder="0" style="border:0; top:0px; left:0px; bottom:0px; right:0px; width:100%; height:100%;" allowfullscreen>
      ${mediaType.startsWith('image') ? `<img src="${base64URL}" style="width: 100%; height: 100%;" />` : ''}
      ${mediaType.startsWith('video') ? `<video controls style="width: 100%; height: 100%;"><source src="${base64URL}" type="${mediaType}" /></video>` : ''}
    </iframe>
  `);
}

function DisplayFormData() {
  const [formData, setFormData] = useState([]);

  useEffect(() => {
    fetchData(); 
  }, []); 

  const fetchData = () => {
    fetch('http://localhost:5000/formData.xml') 
      .then(response => response.text()) 
      .then(xmlData => {
        const jsonData = xml2js(xmlData, { compact: true }); 
        const forms = jsonData.forms?.form || []; 
        setFormData(forms); 
      })
      .catch(error => console.error('Greška pri dohvaćanju podataka:', error));
  };

  return (
    <div>
      <h2>Podaci iz XML datoteke:</h2>
      <table className="formDataTable">
        <thead>
          <tr>
            <th>Ime aplikacije</th>
            <th>Ostalo ime aplikacije</th>
            <th>Mjesto aplikacije</th>
            <th>Ostalo mjesto aplikacije</th>
            <th>Opis problema</th>
            <th>Mediji</th>
            <th>Vrsta uređaja</th>
            <th>Vrsta internetskog preglednika</th>
            <th>Model uređaja</th>
            <th>Verzija operacijskog sustava</th>
            <th>E-adresa</th>
          </tr>
        </thead>
        <tbody>
          {formData.map((form, index) => (
            <tr key={index}>
              <td>{form.appName?._text}</td>
              <td>{form.customAppName?._text}</td>
              <td>{form.location?._text}</td>
              <td>{form.customLocation?._text}</td>
              <td className="description-cell">{form.description?._text}</td>
              <td>
  {form.media && (
    Array.isArray(form.media) ? ( 
      form.media.map((mediaItem, index) => (
        <div key={index}>
          {mediaItem.type && mediaItem.data && mediaItem.name && ( 
            <button onClick={() => debugBase64(`data:${mediaItem.type._text};base64,${mediaItem.data._text}`, mediaItem.type._text)}>
              Prikaz medija
            </button>
          )}
        </div>
      ))
    ) : (
      <div>
        {form.media.type && form.media.data && form.media.name && ( 
          <button onClick={() => debugBase64(`data:${form.media.type._text};base64,${form.media.data._text}`, form.media.type._text)}>
            Prikaz medija
          </button>
        )}
      </div>
    )
  )}
</td>
              <td>{form.deviceType?._text}</td>
              <td>{form.deviceModel?._text}</td>
              <td>{form.osType?._text}</td>
              <td>{form.browserType?._text}</td>
              <td>{form.email?._text}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default DisplayFormData;
